--
-- Name: parse_market_hours(integer, integer, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.parse_market_hours(market_id integer, season_num integer, season_time text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    time_block TEXT;
    day_part TEXT;
    day_of_week TEXT;
    time_range TEXT;
    open_time TIME;
    close_time TIME;
    season_id INT;
BEGIN
    IF season_time IS NULL OR season_time = '' THEN
        RETURN;
    END IF;
    
    -- Находим ID сезона
    SELECT SeasonID INTO season_id 
    FROM MarketSeasons 
    WHERE MarketID = market_id AND SeasonNumber = season_num;
    
    IF season_id IS NULL THEN
        RETURN;
    END IF;
    
    -- Разделяем строку по ';'
    FOR time_block IN SELECT regexp_split_to_table(season_time, ';') LOOP
        IF time_block = '' THEN
            CONTINUE;
        END IF;
        
        -- Разделяем день и время (формат "День: Время")
        day_part := split_part(time_block, ':', 1);
        time_range := split_part(time_block, ':', 2);
        
        -- Очищаем строки от лишних пробелов
        day_of_week := trim(day_part);
        time_range := trim(time_range);
        
        -- Пропускаем если нет времени
        IF time_range = '' THEN
            CONTINUE;
        END IF;
        
        -- Разбираем время (формат "HH:MM AM/PM-HH:MM AM/PM")
        BEGIN
            open_time := to_timestamp(split_part(time_range, '-', 1), 'HH:MI AM')::time;
            close_time := to_timestamp(split_part(time_range, '-', 2), 'HH:MI AM')::time;
            
            -- Вставляем запись
            VALUES (market_id, season_id, day_of_week, open_time, close_time);
        EXCEPTION WHEN OTHERS THEN
            -- Пропускаем некорректные записи
            CONTINUE;
        END;
    END LOOP;
END;
$$;


ALTER FUNCTION public.parse_market_hours(market_id integer, season_num integer, season_time text) OWNER TO postgres;

--
-- Name: parse_season_dates(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.parse_season_dates(season_date text) RETURNS TABLE(start_date date, end_date date)
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF season_date IS NULL OR season_date = '' OR season_date = 'No' THEN
        RETURN;
    END IF;
    
    -- Формат "MM/DD/YYYY to MM/DD/YYYY"
    IF position(' to ' in season_date) > 0 THEN
        BEGIN
            RETURN QUERY 
            SELECT 
                to_date(split_part(season_date, ' to ', 1), 'MM/DD/YYYY'),
                to_date(split_part(season_date, ' to ', 2), 'MM/DD/YYYY');
        EXCEPTION WHEN OTHERS THEN
            RETURN;
        END;
    -- Формат "MM/DD/YYYY"
    ELSIF position('/' in season_date) > 0 THEN
        BEGIN
            RETURN QUERY 
            SELECT 
                to_date(season_date, 'MM/DD/YYYY'),
                to_date(season_date, 'MM/DD/YYYY');
        EXCEPTION WHEN OTHERS THEN
            RETURN;
        END;
    END IF;
    
    RETURN;
END;
$$;


ALTER FUNCTION public.parse_season_dates(season_date text) OWNER TO postgres;

